export default function Todo({ title, description, author, dateCreated, complete, dateCompleted }) {
    return (
        <div>
            <input type="checkbox" checked={complete} onChange={() => { /* This will be handled with a callback */ }} />
            <h3>{title}</h3>
            <div>{description}</div>
            <br />
            <i>Created by <b>{author}</b> on {new Date(dateCreated).toLocaleDateString()}</i>
            {complete && <div>Completed on {new Date(dateCompleted).toLocaleDateString()}</div>}
        </div>
    );
}
